import {
  Add as AddIcon,
  EmailOutlined as Email,
  Phone,
  ArrowForward as ArrowForwardIcon,
  Delete as DeleteIcon
} from '@mui/icons-material';
import {
  Box,
  Breadcrumbs,
  Divider,
  Link,
  List,
  ListItem,
  ListItemButton,
  ListItemText,
  ListSubheader,
  Typography,
  IconButton,
  Select,
  MenuItem,
  FormControl,
  InputLabel,
  FormControlLabel,
  FormLabel,
  Radio,
  RadioGroup
} from '@mui/material';
import { blueGrey } from '@mui/material/colors';
import { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { useFetch } from '../../hooks';
import { API, getURI } from '../../services';
import * as Styled from './Pilots.styled';
import { useAuth } from '../../hooks/useAuth'; // certifique-se de que esse hook está correto

interface IPilot {
  id?: number;
  userId: number;
  firstName: string;
  lastName: string;
  cpf: string;
  cellphone: string;
  email: string;
  status: string;
  agreeStatute?: boolean;
  agreeRI?: boolean;
}

export const Pilots = () => {
  const [pilots, setPilots] = useState<Array<IPilot>>([]);
  const [filteredPilots, setFilteredPilots] = useState<Array<IPilot>>([]);
  const [statusType, setStatusType] = useState<string>('statusPayment');
  const [statusFilter, setStatusFilter] = useState<string>('');
  const [statusOptions, setStatusOptions] = useState<string[]>([]);
  const navigate = useNavigate();
  const { user } = useAuth(); // Contém o papel (role)

  // Busca todos os pilotos (status cadastral)
  const { data: pilotsData } = useFetch<Array<IPilot>>({
    url: getURI(API.pilots)
  });

  // Busca pilotos com status de pagamento
  const { data: pilotsPaymentData } = useFetch<Array<IPilot>>({
    url: getURI(API.pilots) + '/statusPayment'
  });

  // Busca as opções de status cadastral
  const { data: statusCadastralData } = useFetch<string[]>({
    url: getURI(API.pilots) + '/validStatus'
  });

  // Busca as opções de status de pagamento
  const { data: statusPaymentData } = useFetch<string[]>({
    url: getURI(API.pilots) + '/validStatusPayment'
  });

  // Carregar os pilotos baseado no tipo de filtro
  useEffect(() => {
    if (statusType === 'statusCadastral' && pilotsData) {
      setPilots(pilotsData);
      setFilteredPilots(pilotsData);
    } else if (statusType === 'statusPayment' && pilotsPaymentData) {
      setPilots(pilotsPaymentData);
      setFilteredPilots(pilotsPaymentData);
    }
  }, [statusType, pilotsData, pilotsPaymentData]);

  // Atualizar as opções de status baseado no tipo selecionado
  useEffect(() => {
    if (statusType === 'statusCadastral' && statusCadastralData) {
      setStatusOptions(statusCadastralData);
    } else if (statusType === 'statusPayment' && statusPaymentData) {
      setStatusOptions(statusPaymentData);
    }
  }, [statusType, statusCadastralData, statusPaymentData]);

  const handlePilotClick = (pilot: IPilot) => {
    navigate('/pilots/' + pilot.userId);
  };

  const handleStatusChange = (event: any) => {
    const selectedStatus = event.target.value as string;
    setStatusFilter(selectedStatus);

    if (selectedStatus) {
      const filtered = pilots.filter(
        (pilot) => pilot.status === selectedStatus
      );
      setFilteredPilots(filtered);
    } else {
      setFilteredPilots(pilots);
    }
  };

  const handleStatusType = (event: React.ChangeEvent<HTMLInputElement>) => {
    const newStatusType = event.target.value as string;
    setStatusType(newStatusType);
    setStatusFilter('');
  };

  const handleDeleteUser = async (userId: number) => {
    const confirmDelete = window.confirm(
      'Tem certeza que deseja excluir este usuário e seu respectivo piloto?'
    );
    if (!confirmDelete) return;

    try {
      const response = await fetch(getURI(API.deleteUser(userId)), {
        method: 'DELETE',
        headers: { 'Content-Type': 'application/json' }
      });

      if (response.ok) {
        alert('Usuário e piloto excluídos com sucesso.');
        const updated = filteredPilots.filter((p) => p.userId !== userId);
        setFilteredPilots(updated);
        setPilots(updated);
      } else {
        const data = await response.json();
        alert('Erro ao excluir: ' + (data.message || 'erro desconhecido'));
      }
    } catch (err) {
      console.error(err);
      alert('Erro de comunicação com o servidor.');
    }
  };

  return (
    <>
      <Box>
        <Box sx={{ padding: '15px' }}>
          <Breadcrumbs aria-label="breadcrumb">
            <Link underline="hover" color="inherit" href="/">
              Dashboard
            </Link>
            <Typography color="text.primary">Pilotos</Typography>
          </Breadcrumbs>
        </Box>

        {/* Filtro de status */}
        <Box
          sx={{
            alignItems: 'center',
            display: 'flex',
            justifyContent: 'space-around',
            padding: '15px 0'
          }}
        >
          <Box sx={{ mr: 2, width: '300px' }}>
            <FormControl>
              <FormLabel id="filterPilotsType">Filtro por status:</FormLabel>
              <RadioGroup
                row
                aria-labelledby="filterPilotsType"
                defaultValue="statusPayment"
                name="radio-buttons-status"
                onChange={handleStatusType}
              >
                <FormControlLabel
                  value="statusCadastral"
                  control={<Radio />}
                  label="Cadastral"
                />
                <FormControlLabel
                  value="statusPayment"
                  control={<Radio />}
                  label="Pagamento"
                />
              </RadioGroup>
            </FormControl>
          </Box>

          <Box sx={{ mr: 2, width: '300px' }}>
            <FormControl fullWidth>
              <InputLabel id="status-filter">Status</InputLabel>
              <Select
                labelId="status-filter"
                value={statusFilter}
                label="Status"
                onChange={handleStatusChange}
                sx={{ borderRadius: 3 }}
              >
                <MenuItem value="">Todos</MenuItem>
                {statusOptions.map((status) => (
                  <MenuItem key={status} value={status}>
                    {status.charAt(0).toUpperCase() + status.slice(1)}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
          </Box>
        </Box>

        {filteredPilots && (
          <List
            subheader={
              <ListSubheader component="div" color="primary">
                Total de {filteredPilots.length} piloto(s) em nossa base de
                dados.
              </ListSubheader>
            }
          >
            {filteredPilots.map((pilot) => (
              <Box key={pilot.userId}>
                <ListItem
                  disablePadding
                  secondaryAction={
                    <Box sx={{ display: 'flex', alignItems: 'center' }}>
                      {user && user.role === 'admin' && (
                        <IconButton
                          edge="end"
                          aria-label="deletar"
                          onClick={() => handleDeleteUser(pilot.userId)}
                          sx={{ color: 'error.main', mr: 1 }}
                        >
                          <DeleteIcon />
                        </IconButton>
                      )}
                      <IconButton
                        edge="end"
                        aria-label="ver detalhes"
                        onClick={() => handlePilotClick(pilot)}
                      >
                        <ArrowForwardIcon />
                      </IconButton>
                    </Box>
                  }
                >
                  <ListItemButton onClick={() => handlePilotClick(pilot)}>
                    <ListItemText
                      primary={`${pilot.firstName} ${pilot.lastName}`}
                      secondary={
                        <span style={{ display: 'flex', alignItems: 'center' }}>
                          <Phone sx={{ fontSize: '14px' }} />
                          <Typography
                            sx={{ paddingLeft: '5px', paddingTop: '2px' }}
                            variant="caption"
                            color={blueGrey[500]}
                          >
                            {pilot.cellphone}
                          </Typography>
                          <Email sx={{ fontSize: '15px', ml: 1 }} />
                          <Typography
                            sx={{ paddingLeft: '5px' }}
                            variant="caption"
                            color={blueGrey[500]}
                          >
                            {pilot.email}
                          </Typography>
                        </span>
                      }
                    />
                  </ListItemButton>
                </ListItem>
                <Divider />
              </Box>
            ))}
          </List>
        )}
      </Box>

      <Styled.AddButton color="primary" aria-label="add">
        <AddIcon />
      </Styled.AddButton>
    </>
  );
};
